description:
This dataset from the US Department of Energy provides the Grant Program Allocation amounts by county for the US. Because the data are originally by county and city, all levels have been aggregated to the county level. 

Cities and counties with the same name have their Allocation amount combined. Counties without grant money have been left out.

&quot;Over $2.6 billion in formula grants are now available to U.S. states, territories, local governments and Indian tribes under the Energy Efficiency and Conservation Block Grant (EECBG) Program.&quot;
